// src/pages/GettingStarted.js
import React from 'react';

const GettingStarted = () => {
    return (
        <div>
            <h2>Getting Started</h2>
            <p>Learn the basics of using a smartphone or computer, designed for beginners.</p>
        </div>
    );
};

export default GettingStarted;
